import { useState } from "react";

const SearchBar = () => {
  const [search, setSearch] = useState<String>("");

  return (
    <form className="searchBar">
      <input
        className="input"
        onChange={(e) => setSearch(e.target.value)}
        placeholder="Search characters"
      />
    </form>
  );
};

export default SearchBar;
